STUDIP.SupportPlugin={init:function(){$("#supportlinks").sortable({axis:"y",stop:function(){var a={};a.link_ids={};$("#supportlinks").find("div.supportlink").each(function(){a.link_ids[$(this).attr("id")]=$(this).attr("id")});var b=$("#supportlinks").data("sort-url");b=b.substring(1,b.length-1);$.ajax({type:"POST",url:b,data:a})}});$("#supportfaqs").sortable({axis:"y",stop:function(){var a={};a.faq_ids={};$("#supportfaqs").find("article").each(function(){a.faq_ids[$(this).attr("class")]=$(this).attr("class")});
var b=$("#supportfaqs").data("sort-url");b=b.substring(1,b.length-1);$.ajax({type:"POST",url:b,data:a})}})},selectSearchResult:function(a){a=$("#supportsearch").data("redirect-url").split("?")[0]+"/"+a;window.location.href=a}};
